gh the use of automated software or through a physical or mechanical system, is strictly prohibited. You may not frame or utilize framing techniques to enclose any trademark, logo, or other proprietary information (including images, text and page layout) of the SFA or its members without the express written consent of the SFA or its members. You may not use any meta tags or any other &ldquo;hidden text&rdquo; utilizing the name or trademarks of the SFA or its members without the express written consent of the SFA or its members.</p>\r\n\r\n<p>Any unauthorized use of the Websites or violation of any of the foregoing terms shall result in the automatic termination of the foregoing limited license.</p>\r\n\r\n<h2>Registered Users</h2>\r\n\r\n<p>As a registered user of the Websites you may set up a personal dashboard on the Websites for the purpose of enhancing your ability to obtain information regarding the SFA, its members and members&rsquo; products, and to communicate with the SFA and its members. You may enter personal information and preferences on your dashboard in order to enhance your Website experience. The information on your personal dashboard may not be viewed or accessed by SFA members or other Website users. You may choose at any time to not allow SFA members to contact you via your personal dashboard.</p>\r\n\r\n<p>As a registered user of the Websites you may also set up a user profile for the purpose of participating in interactive forums with other registered users. You may enter personal information in your user profile in order to identify and describe yourself to other participants in the interactive forums. The information in your user profile may be viewed by other registered users.</p>\r\n\r\n<p>As a registered user of the Websites, you are responsible for maintaining the confidentiality of your personal dashboard, your account, your user password, and for restricting access to your computer, and you agree to accept responsibility for all activities that occur under your account or user profile or on your dashboard. You may not use a false e-mail address, impersonate any person or entity, or otherwise mislead as to the origin any information or content provided by you on your personal dashboard, in your user profile, or on the Websites. You may use your personal dashboard and user profile solely for the purposes for which they were intended. Any unauthorized use is prohibited.</p>\r\n\r\n<h2>Anticompetitive Behavior</h2>\r\n\r\n<p>Users of any chat rooms or forums on the Websites which permit interaction with other users are prohibited from engaging in behavior which may be construed as anticompetitive or in violation of antitrust laws. Agreements among competitors (and sometimes others) designed to restrict the free operation of markets may lead to civil liability, and may also constitute criminal conduct. Messages that might be construed as encouraging or facilitating other users to agree on prohibited topics cannot be posted on the Websites. This includes any messages about:</p>\r\n\r\n<ul>\r\n	<li>Prices</li>\r\n	<li>Significant costs</li>\r\n	<li>Discounts, or other terms of sale</li>\r\n	<li>Salaries paid to employees</li>\r\n	<li>Specific customers or vendors</li>\r\n	<li>Agreements or proposed agreements between competitors to engage in any joint activity whatsoever</li>\r\n</ul>\r\n\r\n<p>Users must interpret this prohibition broadly. An explicit agreement, or concerted action, is not necessarily required to demonstrate a violation of the antitrust laws &ndash; when combined with other evidence, statements about these topics may demonstrate a violation.</p>\r\n\r\n<p>The consequences for violating antitrust laws are severe. The maximum criminal penalty for conspiring to restrict free trade is $1 million for individuals, and from $10 million to $100 million for a corporation, with higher fines possible in certain circumstances. Individuals and corporate officers who are found guilty of price fixing or similar conduct will almost always be sentenced to imprisonment. Even if prohibited conduct does not rise to the level of criminal punishment, the government can pursue injunctive action that could put SFA members &ndash; or the SFA itself &ndash; out of business. Private plaintiffs may also sue for violations of the antitrust laws, and may be entitled to treble damages (3 times actual damages) if they are successful. The possibility of company-ending class actions is real.</p>\r\n\r\n<h2>User Content</h2>\r\n\r\n<p>If as a registered user of the Websites you post content or submit material (other than content or material on your personal dashboard), you grant the SFA a nonexclusive, royalty-free, perpetual, irrevocable, and fully sub-licensable right to use, reproduce, modify, adapt, publish, translate, create derivative works from, distribute, and display such content or material throughout the world in any media. You represent and warrant that such content or material is not obscene, threatening, defamatory, invasive of privacy, infringing on intellectual property rights of or otherwise injurious to third parties, or otherwise illegal; and that you indemnify the SFA for all claims resulting from such content or material. The SFA has the right but not the obligation to monitor, edit or remove any content or material in violation of these rules or deemed harmful or inappropriate by SFA, and to take such other action SFA deems appropriate, including giving warnings, deleting posts, banning posters, or terminating accounts. The SFA takes no responsibility and assumes no liability for any content posted by you, any other registered user, or any third party.</p>\r\n\r\n<h2>Age Limitation</h2>\r\n\r\n<p>If you are under 18, you may use the Websites only under the supervision of a parent or guardian.</p>\r\n\r\n<h2>Website Content</h2>\r\n\r\n<p>The SFA makes no representation nor has any control over the content of any other websites accessed from the Websites, incl