n of these Terms and Conditions without the filing or posting of any bond or surety.</p>'),
(64, 'about', '<p>The key to a good food website&mdash; whether it&#39;s a recipe blog, a restaurant website or selling a product&mdash; is&nbsp;<em>photography</em>. When you browse the designs below, notice how all the best designs have excellent photography.</p>\r\n\r\n<p>A good food website design don&#39;t need to be ornamental&mdash; it can be simple and straightforward in order to let the food photography shine. It&#39;s not that branding isn&#39;t important, it&#39;s just that it&#39;s best communicated through colors and logos.</p>\r\n\r\n<p>My work is supported by affiliate commissions&mdash; so I may earn a comission if you choose a website builder based on this article.</p>'),
